 
 // https://leetcode.com/problems/find-the-difference/description/
 import Foundation
 func findTheDifference(_ s: String, _ t: String) -> Character {
    var tmp = s
    for c in t {
        if tmp.contains(c) {
            if let index = tmp.index(of: c) {
                tmp.remove(at: index)
            }

        } else {
            return c
        }
    }
    
    return t.last!
 }
 
 extension Character
 {
    func toInt() -> Int
    {
        var intFromCharacter:Int = 0
        for scalar in String(self).unicodeScalars
        {
            intFromCharacter = Int(scalar.value)
        }
        return intFromCharacter
    }
 }
 
 // 83.19%
 func findTheDifference_2(_ s: String, _ t: String) -> Character {
    var x = 0
    for c in s {
        x ^= c.toInt()
    }
    
    for c in t {
        x ^= c.toInt()
    }
    
    return Character(UnicodeScalar(x)!)
 }
 
 // 52.21%
 func findTheDifference_3(_ s: String, _ t: String) -> Character {
    var map = [Character: Int]()
    for c in t {
        if let count = map[c] {
            map[c] = count + 1
        } else {
            map[c] = 1
        }
    }
    
    for c in s {
        if let count = map[c], count > 0 {
            map[c] = count - 1
        }
    }
    
    for (key, count) in map {
        if count == 1 {
            return key
        }
    }
    
    return Character("")
 }
 
 
 let s = ""
 let t = ""
 print(findTheDifference(s, t))
 print(findTheDifference_2(s, t))
 print(findTheDifference_3(s, t))
